import React, { Component } from 'react'
import AppContext, { AppProvider } from '../../../AppContext'
import styles from './ChatHistory.module.scss'

export default class ChatHistory extends Component {

    getChatHistory = () => {
        return Object.keys(this.context.mockHistory.messages).map((element, index) =>
            <div key={index}>{this.context.mockHistory.messages[element]}</div>
        );
    }

    static contextType = AppContext;

    render() {
        //         Object.keys(this.context.mockHistory.messages).map((element, index) =>
        //         console.log(this.context.mockHistory.messages[element], index)
        // );
        return (
            <AppProvider>
                <div className={styles.chatHistory}>
                    {/* {this.context.mockHistory.messages.map((element, index) =>
                            <div>{index}</div>
                    )} */}
                    {this.getChatHistory()}
                </div>
            </AppProvider>
        )
    }
}
